import React from 'react';

const Categorie = ({filtercatego,Allcategorii}) => {
  return (
    <section>

        
<div className='blockButton'>

<button onClick={()=>filtercatego('all')}>All</button>
<button onClick={()=>filtercatego('breakfast')}>Breakfast</button>
<button onClick={()=>filtercatego('lunch')}>Lunch</button>
<button onClick={()=>filtercatego('shakes')}>Shakes</button>


</div>
      
    </section>
  );
}

export default Categorie;
